import axios from 'axios'

const CARPARKING_REST_API_URL = 'http://http://localhost:8081/api/v1/parking?keyword=CA-d';

class CarParkingService{
    getsCarParking(){
     axios.get(CARPARKING_REST_API_URL);
    }
}
export default new CarParkingService();
